// FriendsList.js
import React from 'react';

const FriendsList = ({ friends, onSelect }) => {
  const style = {
    display: 'flex',
    overflowX: 'scroll'
  };

  return (
    <div style={style}>
      {friends.map((friend) => (
        <div key={friend.id} onClick={() => onSelect(friend.id)}>
          {friend.nickname}
        </div>
      ))}
    </div>
  );
};

export default FriendsList
